import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import AppLivestorm from './App/AppLivestorm/AppLivestorm';
import Library from "./Library/AppLibrary/AppLibrary";
import Header from "./Header";



export default function LivestormTestHome() {

  const [hideHeader , setHideHeader] = useState(false);

    return (
    <Router>
    <Header headerState={[hideHeader,setHideHeader]} />
        <div>
          <Routes>
              <Route exact path='/livestorm-test' headerState={[hideHeader,setHideHeader]} component={AppLivestorm} />
              <Route path='/livestorm-test/library' headerState={[hideHeader,setHideHeader]} component={Library} />
          </Routes>
        </div>
      </Router>
    );
}
